import React from 'react';

const UpdatePreferencesPage = () => {
  return (
    <div className="flex items-center justify-center min-h-[calc(100vh-80px)]">
      <div className="bg-white p-8 rounded-lg shadow-lg w-full max-w-2xl text-center">
        <h2 className="text-3xl font-bold mb-6 text-text-dark">Update Your Preferences</h2>
        <p className="text-lg text-gray-700">This page will allow you to update your activity preferences.</p>
        <p className="text-sm text-gray-500 mt-4">Implementation for preference updates will go here.</p>
      </div>
    </div>
  );
};

export default UpdatePreferencesPage;
